import React, { useState, useEffect, useRef } from "react";
import analysis from "../images/land-analysis.jpeg"
const { tableau } = window;


function Scenario1(){
  const url = 'https://public.tableau.com/views/Land_16846774392970/Dashboard1';
  const ref = useRef(null);

  const initViz = () => {
    new tableau.Viz(ref.current, url, {
      width: "100%",
      height: "100%"
    });
  };

  useEffect(initViz, []);

  return (
    <div className="embed">
      <h1>Land rates in Melbourne</h1>
      <div className="viz-container" ref={ref} />
       <div className="image-container">
          <img className="image" src={analysis} alt="Image 1" />
          <p className="image-description"><b>Chart 1</b> reveals that the lowest activity levels occur between 3 to 4 am, while a notable surge in activity is observed from 6 am onwards, with the peak occurring at 8 pm. The time frame from 6 pm to 9 pm emerges as a vibrant period for Twitter engagement, coinciding with the leisure time of working adults</p>
      </div> 
    </div>
  );
}




export default Scenario1;
